--
-- Create procedure `Proc_Asset_GetMaxCode`
--
CREATE
DEFINER = 'root'@'localhost'
PROCEDURE Proc_Asset_GetMaxCode ()
COMMENT 'Lấy mã lớn nhất'
BEGIN
  DECLARE n int DEFAULT 0;
  DECLARE i int DEFAULT 0;
  DECLARE zeroNumber nvarchar(10) DEFAULT '';
  DECLARE maxCode int DEFAULT 0;
  SET @empCode = '';
  SELECT
    COUNT(*)
  FROM asset INTO n;

  SET i = 0;
  WHILE i < n DO
    SET @code = (SELECT
        asset_code
      FROM asset LIMIT i, 1);
    SET @numberCode = (SELECT
        SUBSTRING_INDEX (@code, '-', -1));
    SET @numberCodeSigned = (SELECT
        CONVERT(@numberCode, SIGNED));
    SET zeroNumber = (SELECT
        SUBSTRING_INDEX (@numberCode, @numberCodeSigned, 1));
    IF (maxCode < @numberCodeSigned) THEN
      SET maxCode = @numberCodeSigned;
    END IF;
    SET @assetCode = CONCAT('', zeroNumber, maxCode);
    SET i = i + 1;
  END WHILE;
  SELECT
    @assetCode;
END
$$

--
-- Create procedure `Proc_Asset_GetById`
--
CREATE
DEFINER = 'root'@'localhost'
PROCEDURE Proc_Asset_GetById (IN p_asset_id char(36))
COMMENT 'Lấy tài sản theo id'
BEGIN
  SELECT
    a.asset_id,
    a.asset_code,
    a.asset_name,
    a.organization_id,
    a.organization_code,
    a.organization_name,
    a.department_id,
    a.department_code,
    a.department_name,
    a.asset_category_id,
    a.asset_category_code,
    a.asset_category_name,
    a.purchase_date,
    a.cost,
    a.quantity,
    a.depreciation_rate,
    a.tracked_year,
    a.life_time,
    a.production_year,
    a.active,
    a.created_by,
    a.created_date,
    a.modified_by,
    a.modified_date,
    ac.description
  FROM asset a
    JOIN asset_category ac
      ON a.asset_category_id = ac.asset_category_id
    JOIN department d
      ON a.department_id = d.department_id
  WHERE a.asset_id = p_asset_id;
END
$$

--
-- Create procedure `Proc_Asset_GetByAssetCode`
--
CREATE
DEFINER = 'root'@'localhost'
PROCEDURE Proc_Asset_GetByAssetCode (IN p_asset_code varchar(255))
BEGIN
  SELECT
    a.asset_id,
    a.asset_code,
    a.asset_name,
    a.department_name,
    a.cost,
    (a.depreciation_rate * a.cost) / 12 * (TIMESTAMPDIFF(MONTH, a.production_year, NOW())) AS depreciation_value,
    (a.cost - (a.depreciation_rate * a.cost) / 12 * (TIMESTAMPDIFF(MONTH, a.production_year, NOW()))) AS residual_value
  FROM asset a
  WHERE a.asset_code = p_asset_code;
END
$$

