--
-- Create procedure `Proc_Asset_GetAll`
--
CREATE
DEFINER = 'root'@'localhost'
PROCEDURE Proc_Asset_GetAll ()
COMMENT 'Lấy tất cả tài sản'
BEGIN
  SELECT
    COUNT(*) AS totalRecord
  FROM asset a;

  SELECT
    a.asset_id,
    a.asset_code,
    a.asset_name,
    a.organization_id,
    a.organization_code,
    a.organization_name,
    a.department_id,
    a.department_code,
    a.department_name,
    a.asset_category_id,
    a.asset_category_code,
    a.asset_category_name,
    a.purchase_date,
    a.cost,
    a.quantity,
    a.depreciation_rate,
    a.tracked_year,
    a.life_time,
    a.production_year,
    a.active,
    a.created_by,
    a.created_date,
    a.modified_by,
    a.modified_date
  FROM asset a;

  SELECT
    SUM(a.quantity) AS totalQuantity
  FROM asset a;

  SELECT
    SUM((a.depreciation_rate * a.cost) / 12 * (TIMESTAMPDIFF(MONTH, a.production_year, NOW()))) AS totalDepreciationValue
  FROM asset a;

  SELECT
    SUM(a.cost - (a.depreciation_rate * a.cost) / 12 * (TIMESTAMPDIFF(MONTH, a.production_year, NOW()))) AS totalCost
  FROM asset a;

END
$$

--
-- Create procedure `Proc_Asset_Export`
--
CREATE
DEFINER = 'root'@'localhost'
PROCEDURE Proc_Asset_Export (IN p_asset_filter varchar(100), IN p_department_filter char(36), IN p_asset_category_filter char(36))
COMMENT 'lọc tài sản theo id, code, id phòng ban, id loại tài sản phục vụ export'
BEGIN

  SET @KeyWord = CONCAT('%', p_asset_filter, '%');
  SET @KeyWordDepartment = CONCAT('%', p_department_filter, '%');
  SET @KeyWordAssetCategory = CONCAT('%', p_asset_category_filter, '%');

  SELECT
    a.asset_code,
    a.asset_name,
    a.asset_category_code,
    a.asset_category_name,
    a.department_code,
    a.department_name,
    a.quantity,
    a.cost,
    ROUND(a.depreciation_rate * a.cost) / 12 * (TIMESTAMPDIFF(MONTH, a.production_year, NOW())) AS depreciation_value,
    ROUND(a.cost - (a.depreciation_rate * a.cost) / 12 * (TIMESTAMPDIFF(MONTH, a.production_year, NOW()))) AS residual_value
  FROM asset a
  WHERE (a.asset_name LIKE @Keyword
  OR a.asset_code LIKE @Keyword
  OR p_asset_filter = ''
  OR p_asset_filter IS NULL)
  AND (a.department_id LIKE @KeyWordDepartment
  OR p_department_filter = ''
  OR p_department_filter IS NULL)
  AND (a.asset_category_id LIKE @KeyWordAssetCategory
  OR p_asset_category_filter = ''
  OR p_asset_category_filter IS NULL);
END
$$

