--
-- Create table `voucher`
--
CREATE TABLE voucher (
  voucher_id char(36) NOT NULL COMMENT 'id chứng từ',
  voucher_code varchar(50) NOT NULL COMMENT 'mã chứng từ',
  voucher_date datetime DEFAULT NULL COMMENT 'ngày chứng từ',
  increment_date datetime DEFAULT NULL COMMENT 'ngày ghi tăng',
  description varchar(500) DEFAULT NULL,
  price decimal(19, 4) DEFAULT NULL COMMENT 'nguyên giá',
  created_by varchar(50) DEFAULT NULL,
  created_date datetime DEFAULT CURRENT_TIMESTAMP,
  modified_by varchar(50) DEFAULT NULL,
  modified_date timestamp NULL DEFAULT CURRENT_TIMESTAMP,
  PRIMARY KEY (voucher_id)
)
ENGINE = INNODB,
AVG_ROW_LENGTH = 409,
CHARACTER SET utf8mb4,
COLLATE utf8mb4_0900_ai_ci,
COMMENT = 'Ghi tăng tài sản';

DELIMITER $$

--
-- Create procedure `Proc_Voucher_UpdateCost`
--
CREATE
DEFINER = 'root'@'localhost'
PROCEDURE Proc_Voucher_UpdateCost (IN p_voucher_id char(36), IN p_cost decimal(19, 4))
BEGIN
  UPDATE voucher v
  SET v.price = p_cost
  WHERE v.voucher_id = p_voucher_id;
END
$$

--
-- Create procedure `Proc_Voucher_Update`
--
CREATE
DEFINER = 'root'@'localhost'
PROCEDURE Proc_Voucher_Update (IN p_voucher_id char(36), IN p_voucher_code varchar(255), IN p_voucher_date timestamp, IN p_increment_date timestamp, IN p_description text, IN p_price decimal(19, 4))
COMMENT 'Cập nhật chứng từ'
BEGIN
  UPDATE voucher v
  SET voucher_code = p_voucher_code,
      voucher_date = p_voucher_date,
      increment_date = p_increment_date,
      description = p_description,
      price = p_price,
      created_by = '',
      created_date = NOW(),
      modified_by = '',
      modified_date = NOW()
  WHERE voucher_id = p_voucher_id;
END
$$

--
-- Create procedure `Proc_Voucher_Search_Paging`
--
CREATE
DEFINER = 'root'@'localhost'
PROCEDURE Proc_Voucher_Search_Paging (IN p_voucher_filter varchar(50), IN p_page_number int, IN p_page_size int)
COMMENT 'Phân trang và tìm kiếm chứng từ'
BEGIN
  SET @PageIndex = p_page_number;
  SET @PageSize = p_page_size;
  SET @KeyWord = CONCAT('%', p_voucher_filter, '%');
  SET @IndexEnd = @PageIndex * @PageSize;
  SET @IndexStart = @IndexEnd - @PageSize + 1;

  CREATE TEMPORARY TABLE IF NOT EXISTS tbl_voucher_original AS
  SELECT
    ROW_NUMBER() OVER (
    ORDER BY v.modified_date DESC) AS row_index,
    v.voucher_id,
    v.voucher_code,
    v.voucher_date,
    v.increment_date,
    v.description,
    v.price,
    v.created_by,
    v.created_date,
    v.modified_by,
    v.modified_date
  FROM voucher v
  WHERE v.voucher_code LIKE @KeyWord
  OR p_voucher_filter = ''
  OR p_voucher_filter IS NULL;

  -- Lấy số lượng bản ghi sau khi lọc
  SELECT
    COUNT(*) AS total_all_record
  FROM tbl_voucher_original;

  -- Lấy danh sách bản ghi sau khi lọc và phân trang
  SELECT
    *
  FROM tbl_voucher_original po
  WHERE po.row_index BETWEEN @IndexStart AND @IndexEnd;

  -- Lấy tổng nguyên giá sau khi lọc
  SELECT
    SUM(po.price) AS total_cost
  FROM tbl_voucher_original po;

  DROP TEMPORARY TABLE IF EXISTS tbl_voucher_original;
END
$$

--
-- Create procedure `Proc_Voucher_Insert`
--
CREATE
DEFINER = 'root'@'localhost'
PROCEDURE Proc_Voucher_Insert (IN p_voucher_id char(36), IN p_voucher_code varchar(50), IN p_voucher_date datetime, IN p_increment_date datetime, IN p_description varchar(500), IN p_price text)
COMMENT 'Thêm ghi tăng tài sản'
BEGIN
  INSERT INTO voucher (voucher_id, voucher_code, voucher_date, increment_date, description, price, created_by, created_date, modified_by, modified_date)
    VALUES (p_voucher_id, p_voucher_code, p_voucher_date, p_increment_date, p_description, p_price, '', NOW(), '', NOW());
END
$$

