REFERENCES voucher (voucher_id) ON DELETE CASCADE;

DELIMITER $$

--
-- Create procedure `Proc_VoucherDetail_Insert`
--
CREATE
DEFINER = 'root'@'localhost'
PROCEDURE Proc_VoucherDetail_Insert (IN p_voucher_detail_id char(36), IN p_voucher_id varchar(255), IN p_asset_id varchar(255), IN p_asset_code varchar(255), IN p_asset_name varchar(255), IN p_department_name varchar(255), IN p_cost varchar(255), IN p_depreciation_value varchar(255), IN p_residual_value varchar(255))
COMMENT 'Thêm mới một tài sản vào chứng từ'
BEGIN
  INSERT INTO voucher_detail (voucher_detail_id, voucher_id, asset_id, asset_code,
  asset_name, department_name, cost, depreciation_value, residual_value,
  created_by, created_date, modified_by, modified_date)
    VALUES (p_voucher_detail_id, p_voucher_id, p_asset_id, p_asset_code, p_asset_name, p_department_name, p_cost, p_depreciation_value, p_residual_value, '', NOW(), '', NOW());
END
$$

--
-- Create procedure `Proc_VoucherDetail_GetByIdVoucher`
--
CREATE
DEFINER = 'root'@'localhost'
PROCEDURE Proc_VoucherDetail_GetByIdVoucher (IN p_voucher_id char(36))
COMMENT 'Lấy danh sách tài sản theo mã chứng từ'
BEGIN
  CREATE TEMPORARY TABLE IF NOT EXISTS tbl_asset_original AS
  SELECT
    ROW_NUMBER() OVER (
    ORDER BY vd.modified_date DESC) AS row_index,
    vd.voucher_detail_id,
    vd.asset_id,
    vd.voucher_id,
    a.asset_code,
    a.asset_name,
    a.department_name,
    a.cost,
    (a.depreciation_rate * a.cost) / 12 * (TIMESTAMPDIFF(MONTH, a.production_year, NOW())) AS depreciation_value,
    (a.cost - (a.depreciation_rate * a.cost) / 12 * (TIMESTAMPDIFF(MONTH, a.production_year, NOW()))) AS residual_value
  FROM voucher_detail vd
    JOIN asset a
      ON vd.asset_id = a.asset_id
  WHERE vd.voucher_id = p_voucher_id;

  SELECT
    *
  FROM tbl_asset_original po;

  DROP TEMPORARY TABLE IF EXISTS tbl_asset_original;
END
$$

