$$

--
-- Create procedure `Proc_Asset_Search_Paging`
--
CREATE
DEFINER = 'root'@'localhost'
PROCEDURE Proc_Asset_Search_Paging (IN p_asset_filter varchar(100), IN p_page_number int, IN p_page_size int, IN p_department_filter char(36), IN p_asset_category_filter char(36))
COMMENT 'Lọc tài sản + phân trang'
BEGIN
  SET @PageIndex = p_page_number;
  SET @PageSize = p_page_size;
  SET @KeyWord = CONCAT('%', p_asset_filter, '%');
  SET @KeyWordDepartment = CONCAT('%', p_department_filter, '%');
  SET @KeyWordAssetCategory = CONCAT('%', p_asset_category_filter, '%');
  SET @IndexEnd = @PageIndex * @PageSize;
  SET @IndexStart = @IndexEnd - @PageSize + 1;


  CREATE TEMPORARY TABLE IF NOT EXISTS tbl_asset_original AS
  SELECT
    ROW_NUMBER() OVER (
    ORDER BY a.modified_date DESC) AS row_index,
    a.asset_id,
    a.asset_code,
    a.asset_name,
    a.organization_id,
    a.organization_code,
    a.organization_name,
    a.department_id,
    a.department_code,
    a.department_name,
    a.asset_category_id,
    a.asset_category_code,
    a.asset_category_name,
    a.purchase_date,
    a.cost,
    a.quantity,
    a.depreciation_rate,
    (a.depreciation_rate * a.cost) / 12 * (TIMESTAMPDIFF(MONTH, a.production_year, NOW())) AS depreciation_value,
    (a.cost - (a.depreciation_rate * a.cost) / 12 * (TIMESTAMPDIFF(MONTH, a.production_year, NOW()))) AS residual_value,
    a.tracked_year,
    a.life_time,
    a.production_year,
    a.active,
    a.created_by,
    a.created_date,
    a.modified_by,
    a.modified_date,
    v.voucher_code
  FROM asset a
    LEFT JOIN voucher_detail vd
      ON a.asset_id = vd.asset_id
    LEFT JOIN voucher v
      ON v.voucher_id = vd.voucher_id
  WHERE (a.asset_name LIKE @Keyword
  OR a.asset_code LIKE @Keyword

  OR @Keyword = ''
  OR @Keyword IS NULL)
  AND (a.department_id LIKE @KeyWordDepartment
  OR p_department_filter = ''
  OR p_department_filter IS NULL)
  AND (a.asset_category_id LIKE @KeyWordAssetCategory
  OR p_asset_category_filter = ''
  OR p_asset_category_filter IS NULL);

  -- Lấy số lượng bản ghi sau khi lọc
  SELECT
    COUNT(*) AS total_all_record
  FROM tbl_asset_original;

  -- Lấy danh sách bản ghi sau khi lọc và phân trang
  SELECT
    *
  FROM tbl_asset_original po
  WHERE po.row_index BETWEEN @IndexStart AND @IndexEnd;
  -- Lấy số lượng bản ghi sau khi lọc và phân trang
  SELECT
    COUNT(*) AS total_record
  FROM tbl_asset_original po
  WHERE po.row_index BETWEEN @IndexStart AND @IndexEnd;

  -- Lấy tổng số lượng tài sản sau khi lọc
  SELECT
    SUM(po.quantity) AS total_quantity
  FROM tbl_asset_original po;
  -- Lấy tổng nguyên giá sau khi lọc
  SELECT
    SUM(po.cost) AS total_cost
  FROM tbl_asset_original po;
  -- Lấy tổng hao mòn lũy kế
  SELECT
    SUM(po.depreciation_value) AS total_depreciation_value
  FROM tbl_asset_original po;
  -- Lấy tổng giá trị còn lại (là nguyên giá trừ đi hao mòn lũy kế)
  SELECT
    SUM(po.residual_value) AS total_residual_value
  FROM tbl_asset_original po;

  DROP TEMPORARY TABLE IF EXISTS tbl_asset_original;
END
$$

--
-- Create procedure `Proc_Asset_GetByVoucherCode`
--
CREATE
DEFINER = 'root'@'localhost'
PROCEDURE Proc_Asset_GetByVoucherCode (IN p_voucher_code varchar(255))
COMMENT 'Lấy danh sách tài sản dựa trên mã chứng từ'
BEGIN
  CREATE TEMPORARY TABLE IF NOT EXISTS tbl_asset_original AS
  SELECT
    ROW_NUMBER() OVER (
    ORDER BY vd.modified_date DESC) AS row_index,
    vd.voucher_detail_id,
    vd.asset_id,
    vd.voucher_id,
    a.asset_code,
    a.asset_name,
    a.department_name,
    a.cost,
    (a.depreciation_rate * a.cost) / 12 * (TIMESTAMPDIFF(MONTH, a.production_year, NOW())) AS depreciation_value,
    (a.cost - (a.depreciation_rate * a.cost) / 12 * (TIMESTAMPDIFF(MONTH, a.production_year, NOW()))) AS residual_value
  FROM voucher_detail vd
    JOIN asset a
      ON vd.asset_id = a.asset_id
    JOIN voucher v
      ON vd.voucher_id = v.voucher_id
  WHERE v.voucher_code = p_voucher_code;

  SELECT
    *
  FROM tbl_asset_original po;

  DROP TEMPORARY TABLE IF EXISTS tbl_asset_original;
END
$$

