--
-- Create procedure `Proc_Asset_UpdateActive`
--
CREATE
DEFINER = 'root'@'localhost'
PROCEDURE Proc_Asset_UpdateActive (IN p_list varchar(10000), IN p_active int)
BEGIN
  SET @active = p_active;
  SET @updateQuery = CONCAT("UPDATE asset a SET a.active = @active WHERE a.asset_id IN ", p_list);

  SET @countQuery = CONCAT("SELECT COUNT(asset_id) AS TotalRecordUpdated FROM asset WHERE asset_id IN ", p_list);

  PREPARE countQuery FROM @countQuery;
  EXECUTE countQuery;
  DEALLOCATE PREPARE countQuery;

  PREPARE updateQuery FROM @updateQuery;
  EXECUTE updateQuery;

END
$$

