--
-- Create procedure `Proc_Asset_NonActive_Search_Paging`
--
CREATE
DEFINER = 'root'@'localhost'
PROCEDURE Proc_Asset_NonActive_Search_Paging (IN p_asset_filter varchar(100), IN p_page_number int, IN p_page_size int, IN p_list varchar(10000), IN p_list_active text)
COMMENT 'tìm kiếm phân trang tài sản chưa active'
BEGIN
  SET @PageIndex = p_page_number;
  SET @PageSize = p_page_size;
  SET @KeyWord = CONCAT('%', p_asset_filter, '%');
  SET @IndexEnd = @PageIndex * @PageSize;
  SET @IndexStart = @IndexEnd - @PageSize + 1;
  SET @PList = p_list;
  SET @PListActive = p_list_active;

  -- select bảng tạm
  SET @SelectQuery = CONCAT('SELECT * FROM tbl_asset_original po 
     WHERE (po.row_index BETWEEN  @IndexStart AND  @IndexEnd )');
  -- nối chuỗi tạo bảng tạm 
  SET @CreateTemporaryQuery = CONCAT("
  CREATE TEMPORARY TABLE IF NOT EXISTS tbl_asset_original AS
  SELECT ROW_NUMBER() OVER (ORDER BY a.modified_date DESC) AS row_index,
         a.asset_id,
         a.asset_code,
         a.asset_name,
         a.department_id,
         a.department_code,
         a.department_name,
         a.cost,
         (a.depreciation_rate * a.cost)/12 * (TIMESTAMPDIFF(MONTH, a.production_year, NOW())) AS depreciation_value,
         (a.cost - (a.depreciation_rate * a.cost)/12 * (TIMESTAMPDIFF(MONTH, a.production_year, NOW()))) AS residual_value,
         a.active,
         a.created_by,
         a.created_date,
         a.modified_by,
         a.modified_date 
   FROM asset a
   WHERE 
         (a.asset_name LIKE @Keyword 
         OR a.asset_code LIKE @Keyword
         OR @Keyword = ''
         OR @Keyword IS NULL)
         AND ((a.active = 0 AND a.asset_code NOT IN ", @PList, " ) OR (a.active = 1 AND a.asset_code IN ", @PListActive, " ));
");
  -- lấy tổng số bản ghi
  SET @SelectTotal = CONCAT("SELECT COUNT(*) AS total_all_record FROM tbl_asset_original;");

  PREPARE CreateTemporaryQuery FROM @CreateTemporaryQuery;
  EXECUTE CreateTemporaryQuery;

  PREPARE SelectTotal FROM @SelectTotal;
  EXECUTE SelectTotal;

  PREPARE SelectQuery FROM @SelectQuery;
  EXECUTE SelectQuery;

  DROP TEMPORARY TABLE IF EXISTS tbl_asset_original;
END
$$

--
-- Create procedure `Proc_Asset_DeleteList`
--
CREATE
DEFINER = 'root'@'localhost'
PROCEDURE Proc_Asset_DeleteList (IN p_list varchar(10000))
COMMENT 'xóa nhiều tài sản'
BEGIN
  SET @deleteQuery = CONCAT('DELETE FROM asset WHERE asset_id IN ', p_list);

  SET @CountQuery = CONCAT('SELECT COUNT(asset_id) AS TotalRecordDeleted FROM asset WHERE asset_id IN ', p_list);

  PREPARE CountQuery FROM @CountQuery;
  EXECUTE CountQuery;
  DEALLOCATE PREPARE CountQuery;

  PREPARE deleteQuery FROM @deleteQuery;
  EXECUTE deleteQuery;
END
$$

